// ContactButton.js
import React from 'react';
import "./Start.css";

const Contact = () => {
  return (
    <section id="contact">
      <div className="contact container">
        <h1 className="section-title">Contact <span>info</span></h1>
        <div className="contact-items">
          {/* ... */}
        </div>
      </div>
    </section>
  );
}

export default Contact;
